DROP TABLE IF EXISTS `cotizaciones`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `cotizaciones` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Codigo` varchar(20) DEFAULT NULL,
  `Observaciones` varchar(256) DEFAULT NULL,
  `Cantidad` double DEFAULT NULL,
  `Precio` double DEFAULT NULL,
  `Tiempo` int(11) DEFAULT NULL,
  `Alto` double DEFAULT NULL,
  `Ancho` double DEFAULT NULL,
  `Profundidad` double DEFAULT NULL,
  `PesoNeto` double DEFAULT NULL,
  `PesoBruto` double DEFAULT NULL,
  `Producto` int(11) NOT NULL,
  `Proveedor` varchar(32) NOT NULL,
  `Margen` double DEFAULT NULL,
  `Iva` double DEFAULT '0',
  PRIMARY KEY (`Id`),
  KEY `Producto` (`Producto`),
  KEY `Proveedor` (`Proveedor`),
  CONSTRAINT `cotizaciones_ibfk_1` FOREIGN KEY (`Producto`) REFERENCES `productos` (`Id`),
  CONSTRAINT `cotizaciones_ibfk_2` FOREIGN KEY (`Proveedor`) REFERENCES `contrapartes` (`Id`)
