DROP TABLE IF EXISTS `gastos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `gastos` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Anio` int(11) DEFAULT NULL,
  `Mes` int(11) DEFAULT NULL,
  `Motivo` varchar(64) DEFAULT NULL,
  `Base` double DEFAULT NULL,
  `Pagado` double DEFAULT NULL,
  `Iva` int(11) DEFAULT NULL,
  `Irpf` double DEFAULT NULL,
  `Fecha` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `Factura` varchar(32) DEFAULT NULL,
  `Observaciones` varchar(256) DEFAULT NULL,
  `Contraparte` varchar(32) DEFAULT NULL,
  `Cuenta` int(11) DEFAULT NULL,
  `Tipo` varchar(32) DEFAULT NULL,
  `ValorIva` double DEFAULT NULL,
  `ValorIrpf` double DEFAULT NULL,
  `Operacion` int(11) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  KEY `gastos_idx1` (`Anio`),
  KEY `gastos_idx2` (`Mes`),
  KEY `gastos_idx3` (`Motivo`),
  KEY `gastos_idx4` (`Contraparte`),
  KEY `gastos_idx5` (`Factura`),
  KEY `gastos_idx6` (`Cuenta`),
  KEY `gastos_idx7` (`Tipo`),
  KEY `gastos_idx8` (`Operacion`),
  CONSTRAINT `gastos_ibfk_1` FOREIGN KEY (`Cuenta`) REFERENCES `cuentas` (`Id`),
  CONSTRAINT `gastos_ibfk_2` FOREIGN KEY (`Contraparte`) REFERENCES `contrapartes` (`Id`),
  CONSTRAINT `gastos_ibfk_3` FOREIGN KEY (`Operacion`) REFERENCES `operaciones` (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=3163 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

