DROP TABLE IF EXISTS `ingresos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ingresos` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Anio` int(11) DEFAULT NULL,
  `Mes` int(11) DEFAULT NULL,
  `Motivo` varchar(64) DEFAULT NULL,
  `Base` double DEFAULT NULL,
  `Cobrado` double DEFAULT NULL,
  `Iva` int(11) DEFAULT NULL,
  `Fecha` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `Factura` varchar(32) DEFAULT NULL,
  `Observaciones` varchar(256) DEFAULT NULL,
  `Contraparte` varchar(32) DEFAULT NULL,
  `Cuenta` int(11) DEFAULT NULL,
  `Tipo` varchar(32) DEFAULT NULL,
  `ValorIva` double DEFAULT NULL,
  `Operacion` int(11) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  KEY `ingresos_idx1` (`Anio`),
  KEY `ingresos_idx2` (`Mes`),
  KEY `ingresos_idx3` (`Motivo`),
  KEY `ingresos_idx4` (`Contraparte`),
  KEY `ingresos_idx5` (`Factura`),
  KEY `ingresos_idx7` (`Cuenta`),
  KEY `ingresos_idx8` (`Tipo`),
  KEY `ingresos_idx9` (`Operacion`),
  CONSTRAINT `ingresos_ibfk_1` FOREIGN KEY (`Cuenta`) REFERENCES `cuentas` (`Id`),
  CONSTRAINT `ingresos_ibfk_2` FOREIGN KEY (`Contraparte`) REFERENCES `contrapartes` (`Id`),
  CONSTRAINT `ingresos_ibfk_3` FOREIGN KEY (`Operacion`) REFERENCES `operaciones` (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=491 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

