  KEY `movimientos_idx4` (`Conciliado`),
  KEY `movimientos_idx5` (`Observaciones`),
  CONSTRAINT `movimientos_ibfk_1` FOREIGN KEY (`Cuenta`) REFERENCES `cuentas` (`Id`),
  CONSTRAINT `movimientos_ibfk_2` FOREIGN KEY (`Gasto`) REFERENCES `gastos` (`Id`),
  CONSTRAINT `movimientos_ibfk_3` FOREIGN KEY (`Ingreso`) REFERENCES `ingresos` (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=3046 DEFAULT CHARSET=latin1;
