DROP TABLE IF EXISTS `operaciones`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `operaciones` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Fecha` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `Nombre` varchar(64) DEFAULT NULL,
  `Cliente` varchar(32) DEFAULT NULL,
  `Transportista` varchar(32) DEFAULT NULL,
  `Intermediario` varchar(32) DEFAULT NULL,
  `Bultos` int(11) DEFAULT NULL,
  `Volumen` double DEFAULT NULL,
  `Peso` double DEFAULT NULL,
  `Comision` double DEFAULT NULL,
  `Comisionista` varchar(32) DEFAULT NULL,
  `Observaciones` varchar(256) DEFAULT NULL,
  `Anio` int(11) DEFAULT NULL,
  `Estado` varchar(32) DEFAULT NULL,
  `Abierta` int(11) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  KEY `operaciones_idx1` (`Anio`),
  KEY `operaciones_idx2` (`Nombre`),
  KEY `operaciones_idx3` (`Cliente`),
  KEY `operaciones_idx4` (`Transportista`),
  KEY `operaciones_idx5` (`Intermediario`),
  KEY `operaciones_idx6` (`Comisionista`),
  KEY `operaciones_idx7` (`Observaciones`),
  KEY `operaciones_idx8` (`Estado`),
  KEY `operaciones_idx9` (`Abierta`),
  CONSTRAINT `operaciones_ibfk_1` FOREIGN KEY (`Cliente`) REFERENCES `contrapartes` (`Id`),
